import React from 'react';

const App = () => {
    return(
        <>
        <div className="todo_list">
        <div>
            <input placeholder='this is input field'/><button>Botton</button>
        </div>
        <ul>
        <button></button>
            <li>this is todo_list</li>
        </ul>
        </div>
        </>
    );
}

export default App ;
